import React from 'react';
import './text-image.css';
// import Header from '../header';
// import Footer from '../footer';

export default function HomeFeatures({
  text1,
  text2,
  image,
  classname,
  isImageRight = false,
}) {
  const style = {};
  if (isImageRight) {
    style['color'] = 'yellow';
  } else {
    style['color'] = 'green';
  }
  return (
    <div className="landing-1" style={style}>
      <div className="landing-1-1">
        <h1>{text1}</h1>
        <p>{text2}</p>
      </div>
      {/* <h1></h1> */}

      <div className="landing-1-2">
        {/* <div className="landing-1-2"> */}
        <img src={image} alt="" />
        {/* </div> */}
      </div>
      {/* </div> */}
    </div>
  );
}
